import React from 'react';
import { Button, Navbar, Nav, NavDropdown, FormControl,Form } from 'react-bootstrap'
import { LineChart, Line } from 'recharts';
const data = [{name: 'Page A', uv: 100, pv: 2600, amt: 2900},{name: 'Page A', uv: 400, pv: 1200, amt: 1400},{name: 'Page A', uv: 400, pv: 2400, amt: 2400}];
const LandingPage = () => (
  <div>
    <div class="jumbotron">
  <h1>Dashboard de Colombia Viva</h1>
  <p>Aquí encontrarás toda la información de negocio de la app</p>
  <p><a class="btn btn-primary btn-lg" href="#" role="button">Preguntas de negocio</a></p>
</div>
<LineChart width={400} height={400} data={data}>
    <Line type="monotone" dataKey="uv" stroke="#8884d8" />
  </LineChart>
  </div>
);

export default LandingPage;
